  amrex::Real g_RT[55];
  gibbs(g_RT, T);
  amrex::Real g_RT_qss[33];
  gibbs_qss(g_RT_qss, T);

  amrex::Real sc_qss[33];
  amrex::Real kf_qss[397], qf_qss[397], qr_qss[397];
  // Fill sc_qss here
  comp_k_f_qss(T, invT, logT, kf_qss);
  comp_qss_coeff(kf_qss, qf_qss, qr_qss, sc, T, g_RT, g_RT_qss);
